def can_shorten(s):
    for i in range(len(s)):
        t = s[i:i+2]
        if len(t) == 2 and t[0] != t[1] and t[0].lower() == t[1].lower():
            return True
    return False

def f1(s):
    while can_shorten(s):
        for i in range(len(s)):
            t = s[i:i+2]
            if len(t) == 2 and t[0] != t[1] and t[0].lower() == t[1].lower():
                s = s[:i] + s[i + 2:]
    return len(s)

def f2(s):
    all_chars = set(s)
    ans = float('inf')
    for char in all_chars:
        t = s.replace(char.upper(), "")
        t = t.replace(char.lower(), "")
        ans = min(ans, f1(t))
    return ans

a = ""

out = f1(a)
print(out)
print(f2(a))
